      <Switch>
        <Route exact path="/">
          <Homepage />
        </Route>
        <Route path="/page2">
          <Page2 />
        </Route>
        <Route path="/page3">
          <Page3 />
        </Route>
      </Switch>
    </Router>
  );
};

ReactDom.render(<App />, document.getElementById("root"));
